DROP FUNCTION IF EXISTS `FN_DATA_EXIST`;
delimiter ;;
CREATE FUNCTION `FN_DATA_EXIST`(`_dt` varchar(20), `_code` varchar(50))
 RETURNS int
  DETERMINISTIC
BEGIN
	DECLARE cnt BIGINT UNSIGNED;
	select count(*) into cnt from tab_sys where code=_code and dt=_dt;
	return cnt;
END
;;
delimiter ;

